import React from "react";

export default class promotion extends React.Component {
  constructor(props) {
    super();
    this.data = props.data;
  }

  render() {
    return (
      <div>
        <table>
          <tr>
            <th>{this.data.description}</th>
            <th></th>
          </tr>
        </table>
        {this.data.description}
        {this.data.category}
      </div>
    );
  }
}
